"use strict";class App{activeClassToggler(){var e=document.querySelectorAll(".-js-toggler");e&&e.forEach(e=>{e.addEventListener("click",()=>{e.classList.toggle("active")})})}pageReady(){document.body.classList.add("loaded"),document.body.classList.remove("preload")}init(){this.activeClassToggler(),this.pageReady()}}const app=new App;function handleScroll(){var e=document.querySelector(".topbar");1<window.scrollY?e.classList.add("scrolled"):e.classList.remove("scrolled")}window.addEventListener("scroll",handleScroll);